import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Click on a product to open the detail view
    // Using a locator that finds a product card containing specific text for robustness
    const productCard = page.locator('.product-card', { hasText: 'Sony WH-1000XM5' });
    await productCard.waitFor({ state: 'visible', timeout: 5000 });
    await productCard.click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal_opened.png'));

    // 2. Wait for the product detail modal to be visible
    await page.waitForSelector('.modal-content', { state: 'visible', timeout: 5000 });

    // 3. Click the "Add to Wish List" button inside the modal
    // Using getByRole for a more user-centric and accessible selector
    const addToWishlistButton = page.getByRole('button', { name: 'Add to Wish List' });
    await addToWishlistButton.waitFor({ state: 'visible', timeout: 5000 });
    await addToWishlistButton.click();

    // 4. Wait for the success notification and take a screenshot
    await page.waitForSelector('.notification.success', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_added_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_added_to_wishlist.png'));

    // 5. Extract data from localStorage to verify the action
    const wishlistData = await page.evaluate(() => {
      return localStorage.getItem('amazonWishlist');
    });
    const parsedWishlist = JSON.parse(wishlistData);

    return {
      success: true,
      action: "Added 'Sony WH-1000XM5' product to the wishlist.",
      extractedData: {
        wishlistContents: parsedWishlist,
        itemAdded: parsedWishlist.find(item => item.title.includes('Sony WH-1000XM5'))
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
